import './style.css';

export function PreviewLeft({ project }) {

    return (

        <div className="project-preview-left">

            <img src={project.mockupPath} alt={project.mockupAlt} className="project-thumbnail"></img>

            <div className="preview-details-left">

                <h1 className="preview-title">{project.title}</h1>

                <div className="preview-links">
                    <h3 className="preview-link"><a href={project.deployedLink}>Deployed Application</a></h3>
                    <h3 className="preview-link-divider">|</h3>
                    <h3 className="preview-link"><a href={project.repoLink}>GitHub Repository</a></h3>
                </div>

            </div>

        </div>

    );

};

export function PreviewRight({ project }) {

    return (

        <div className="project-preview-right">

            <img src={project.mockupPath} alt={project.mockupAlt} className="project-thumbnail"></img>

            <div className="preview-details-right">

                <h1 className="preview-title">{project.title}</h1>

                <div className="preview-links">
                    <h3 className="preview-link"><a href={project.deployedLink}>Deployed Application</a></h3>
                    <h3 className="preview-link-divider">|</h3>
                    <h3 className="preview-link"><a href={project.repoLink}>GitHub Repository</a></h3>
                </div>

            </div>

        </div>

    );

};
